import sqlite3 from 'sqlite3';
import { open } from 'sqlite';
import { join } from 'path';
import { mkdirSync, existsSync } from 'fs';

const DB_DIR = join(process.cwd(), 'data');
const DB_PATH = join(DB_DIR, 'rahn.db');

let db = null;

export async function getDb() {
  if (typeof window !== 'undefined') {
    throw new Error('Database can only be used on the server side');
  }

  if (!db) {
    if (!existsSync(DB_DIR)) {
      mkdirSync(DB_DIR, { recursive: true });
    }

    db = await open({
      filename: DB_PATH,
      driver: sqlite3.Database
    });

    await db.run('PRAGMA journal_mode = WAL');
    await initDatabase();
  }

  return db;
}

async function initDatabase() {
  await db.run(`
    CREATE TABLE IF NOT EXISTS statuses (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      name TEXT UNIQUE NOT NULL,
      description TEXT,
      color TEXT NOT NULL DEFAULT '#808080',
      CHECK (LENGTH(name) > 0)
    )
  `);

  await db.run(`
    CREATE TABLE IF NOT EXISTS tasks (
      id INTEGER PRIMARY KEY AUTOINCREMENT,
      task_number TEXT UNIQUE NOT NULL,
      name TEXT NOT NULL,
      description TEXT,
      status_id INTEGER NOT NULL,
      created_at DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
      updated_at DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
      FOREIGN KEY (status_id) REFERENCES statuses(id) ON DELETE RESTRICT ON UPDATE CASCADE,
      CHECK (LENGTH(task_number) > 0)
    )
  `);

  await db.run(`
    CREATE INDEX IF NOT EXISTS idx_tasks_status ON tasks(status_id)
  `);

  await db.run(`
    CREATE INDEX IF NOT EXISTS idx_tasks_created_at ON tasks(created_at)
  `);

  await db.run(`
    CREATE INDEX IF NOT EXISTS idx_tasks_task_number ON tasks(task_number)
  `);

  const defaultStatuses = [
    { name: 'Open', color: '#3b82f6' },
    { name: 'In Progress', color: '#f59e0b' },
    { name: 'Done', color: '#10b981' },
    { name: 'On Hold', color: '#6b7280' }
  ];

  for (const status of defaultStatuses) {
    const existing = await db.get('SELECT id FROM statuses WHERE name = ?', [status.name]);
    if (!existing) {
      await db.run('INSERT INTO statuses (name, color) VALUES (?, ?)', [status.name, status.color]);
    }
  }
}

export async function closeDb() {
  if (db) {
    await db.close();
    db = null;
  }
}

export async function generateTaskNumber(type) {
  const db = await getDb();
  const prefix = type === 'bug' ? 'BUG' : 'IDEA';

  const lastTask = await db.get(
    "SELECT task_number FROM tasks WHERE task_number LIKE ? ORDER BY task_number DESC LIMIT 1",
    [`${prefix}-%`]
  );

  let number = 1;
  if (lastTask) {
    const match = lastTask.task_number.match(/-(\d+)$/);
    if (match) {
      number = parseInt(match[1], 10) + 1;
    }
  }

  return `${prefix}-${String(number).padStart(3, '0')}`;
}

export default { getDb, closeDb, generateTaskNumber };

